// src/pages/ProductsListPage.js
import React, { useEffect, useMemo, useState } from "react";
import axios from "axios";
import { Container, Spinner, Alert } from "react-bootstrap";
import { useLocation, Link } from "react-router-dom";

// âœ… mÃªmes styles de carte + grille que la home
import "../components/HomeProducts.css";
import HomeProductCard from "../components/HomeProductCard";

// petit hook pour lire le query-string
function useQS() {
  const { search } = useLocation();
  return useMemo(() => new URLSearchParams(search), [search]);
}

const ProductsListPage = () => {
  const qs = useQS();
  const typeFromURL = (qs.get("type") || "").toLowerCase(); // "face" | "lips" | ...

  const [products, setProducts] = useState([]);
  const [loading,  setLoading]  = useState(true);
  const [error,    setError]    = useState(null);

  // recherche locale (champ de recherche)
  const [q, setQ] = useState("");

  // âš ï¸ ICI: on relance la requÃªte quand `typeFromURL` change
  useEffect(() => {
    let alive = true;
    setLoading(true);
    setError(null);

    axios
      .get("/api/products/", {
        // on envoie le filtre au backend
        params: { type: typeFromURL || undefined },
      })
      .then(({ data }) => {
        if (!alive) return;
        setProducts(Array.isArray(data) ? data : []);
      })
      .catch((e) => {
        if (!alive) return;
        setError(e?.response?.data?.detail || e.message);
      })
      .finally(() => alive && setLoading(false));

    return () => { alive = false; };
  }, [typeFromURL]);

  // ðŸ” Fallback: si ton backend nâ€™implÃ©mente pas encore le filtre,
  // on filtre cÃ´tÃ© client en se basant sur product.type OU product.category
  const byType = useMemo(() => {
    if (!typeFromURL) return products;
    return products.filter((p) => {
      const t1 = (p.type || "").toLowerCase();
      const t2 = (p.category || "").toLowerCase();
      return t1 === typeFromURL || t2 === typeFromURL;
    });
  }, [products, typeFromURL]);

  // recherche locale
  const filtered = useMemo(() => {
    const needle = q.trim().toLowerCase();
    if (!needle) return byType;
    return byType.filter((p) =>
      (p.name || "").toLowerCase().includes(needle) ||
      (p.description || "").toLowerCase().includes(needle)
    );
  }, [byType, q]);

  return (
    <Container className="py-5">
      {/* Titre + recherche */}
      <div className="d-flex flex-wrap align-items-center justify-content-between mb-3">
        <h2 className="m-0 font-display fw-700">
          {typeFromURL ? `Produits â€” ${typeFromURL}` : "Tous les produits"}
        </h2>

        <input
          type="search"
          className="form-control"
          placeholder="Rechercher un produitâ€¦"
          style={{ minWidth: 260 }}
          value={q}
          onChange={(e) => setQ(e.target.value)}
        />
      </div>

      {/* (facultatif) boutons rapides pour tester les filtres */}
      <div className="d-flex gap-2 mb-3 flex-wrap">
        {[
          {k:"", label:"Tous"},
          {k:"face", label:"Visage"},
          {k:"lips", label:"LÃ¨vres"},
          {k:"eyes", label:"Yeux"},
          {k:"eyebrow", label:"Sourcils"},
          {k:"hair", label:"Cheveux"},
        ].map(({k,label}) => (
          <Link
            key={k}
            to={`/products${k ? `?type=${k}` : ""}`}
            className={`btn btn-sm ${typeFromURL===k ? "btn-dark" : "btn-outline-secondary"}`}
          >
            {label}
          </Link>
        ))}
      </div>

      {/* Loading / Error */}
      {loading && (
        <div className="d-flex justify-content-center py-5">
          <Spinner animation="border" />
        </div>
      )}
      {error && <Alert variant="danger">{error}</Alert>}

      {/* Grid */}
      {!loading && !error && (
        filtered.length > 0 ? (
          <div className="hp-grid">
            {filtered.map((p) => <HomeProductCard key={p.id} product={p} />)}
          </div>
        ) : (
          <div className="text-center text-muted py-5">
            Aucun produit trouvÃ©.
          </div>
        )
      )}
    </Container>
  );
};

export default ProductsListPage;
